import React, {Component} from 'react'

class Login extends Component {
  render() {
      return (
          <body>
            <div>
                Reni

            </div>
            <style jsx>{`
                body {
                  padding: 0rem;
                  margin: 0;
                }
                div {
                  border: 2px solid 'greenlight';
                  padding: 20px; 
                  width: 300px;
                  resize: both;
                  overflow: auto;
               }

                section {
                  font-size: 5rem;
                  background-color: blue;
                }
              `}</style>


          </body>
      )
  }
}

export default Login
